import React, { Component, Fragment } from "react";
import "./sidebar.css";

class Sidebar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    console.log("hi");
  }

  componentWillUnmount() {}

  render() {
    return (
      <Fragment>
        <img src="./bob.jpeg" />
        <ul>
          <li>Top</li>
          <li>Languages</li>
          <li>Frameworks</li>
          <li>Libraries</li>
          <li>Samples</li>
          <li>Education</li>
          <li>About Me</li>
          <li>Contact</li>
        </ul>
      </Fragment>
    );
  }
}

export default Sidebar;
